{
  "singleQuote": true,
  "trailingComma": "all",
  "arrowParens": "avoid",
  "proseWrap": "never",
  "overrides": [
    {
      "files": ["*.md", "*.mdx"],
      "options": {
        "printWidth": 80,
        "proseWrap": "preserve"
      }
    },
    {
      "files": "*.svg",
      "options": {
        "parser": "html"
      }
    }
  ]
}

// for ESM don't transpile modules

const envConfig = {
  modules: 'commonjs',
};

if (process.env.ESM) {
  envConfig.modules = false;
  envConfig.targets = { node: 'current' };
  envConfig.bugfixes = true;
}

if (process.env.CDN) {
  envConfig.modules = 'umd';
  envConfig.targets = null;
}

module.exports = {
  presets: [
    [require.resolve('@babel/preset-env'), envConfig],
    require.resolve('@babel/preset-react'),
    require.resolve('@babel/preset-typescript'),
  ],
  env: {
    test: {
      presets: [
        [require.resolve('@babel/preset-env'), envConfig],
        [require.resolve('@babel/preset-react'), { runtime: 'automatic' }],
        require.resolve('@babel/preset-typescript'),
      ],
      plugins: [require.resolve('babel-plugin-macros')],
    },
    development: {
      compact: false,
    },
  },
  plugins: [
    require.resolve('@babel/plugin-proposal-class-properties'),

    require.resolve('@babel/plugin-proposal-nullish-coalescing-operator'),
    require.resolve('@babel/plugin-proposal-optional-chaining'),
    require.resolve('@babel/plugin-transform-private-methods'),
    ['babel-plugin-transform-import-meta', { module: 'ES6' }],
  ],
};

{
  "$schema": "https://raw.githubusercontent.com/streetsidesoftware/cspell/main/cspell.schema.json",
  "language": "en",
  "useGitignore": true,
  "cache": {
    "useCache": true
  },
  "dictionaries": ["custom-words"],
  "dictionaryDefinitions": [
    {
      "name": "custom-words",
      "path": "./resources/custom-words.txt",
      "addWords": true
    }
  ],
  "ignorePaths": [
    "**/CHANGELOG.md",
    "**/package.json",
    "**/esbuild.js",
    ".eslintrc.js",
    ".vscode/extensions.json"
  ],
  "files": ["**/*.{js,cjs,mjs,ts,jsx,tsx,md,mdx,html,json,css,toml,yaml,yml}"]
}

const path = require('node:path');

module.exports = (dir, env = 'jsdom') => {
  const package = require(`${dir}/package.json`);
  const setupFilesAfterEnv = [];
  if (env === 'jsdom') {
    setupFilesAfterEnv.push(path.join(__dirname, '/resources/test.config.js'));
  }
  return {
    globals: {
      'ts-jest': {
        tsConfig: `${__dirname}/resources/tsconfig.base.esm.json`,
      },
    },
    clearMocks: true,
    collectCoverage: true,
    coverageDirectory: `${__dirname}/coverage/jest`,
    setupFilesAfterEnv,
    moduleNameMapper: {
      '\\.css$': 'identity-obj-proxy',
      '^graphql-language-service-([^/]+)': `${__dirname}/packages/graphql-language-service/src/$1`,
      '^graphql-language-([^/]+)': `${__dirname}/packages/graphql-language-$1/src`,
      '^@graphiql\\/([^/]+)': `${__dirname}/packages/graphiql-$1/src`,
      '^codemirror-graphql\\/esm([^]+)\\.js': `${__dirname}/packages/codemirror-graphql/src/$1`,
      '^codemirror-graphql\\/cjs([^]+)': `${__dirname}/packages/codemirror-graphql/src/$1`,
      // relies on compilation
      '^cm6-graphql\\/src\\/([^]+)': `${__dirname}/packages/cm6-graphql/dist/$1`,
      // because of the svelte compiler's export patterns i guess?
      'svelte/compiler': `${__dirname}/node_modules/svelte/compiler.cjs`,
    },
    testMatch: ['**/*[-.](spec|test).[jt]s?(x)', '!**/cypress/**'],
    testEnvironment: env,
    testPathIgnorePatterns: ['node_modules', 'dist', 'cypress'],
    collectCoverageFrom: ['**/src/**/*.{js,jsx,ts,tsx}'],
    transformIgnorePatterns: ['node_modules/(!@astrojs/compiler)'],
    coveragePathIgnorePatterns: [
      'dist',
      'esm',
      'node_modules',
      '__tests__',
      'resources',

      'examples',
      '.d.ts',
      'types.ts',
    ],

    roots: ['<rootDir>'],

    rootDir: dir,
    name: package.name,
    displayName: package.name,
  };
};

module.exports = {
  projects: ['<rootDir>/packages/*/jest.config.js'],
};

{
  "packageAllowlist": [
    // MIT, just lacking SPDX in manifest
    "valid-url",
    "argparse"
  ],
  "dev": false
}

{
  // https://typescript-eslint.io/docs/linting/typed-linting/monorepos/#one-root-tsconfigjson
  // extend your base config to share compilerOptions, etc
  "extends": "./tsconfig.json",
  "compilerOptions": {
    // ensure that nobody can accidentally use this config for a build
    "noEmit": true
  },
  "include": [
    "packages/*/src/*/__tests__/**/*.ts",
    "packages/*/src/__tests__/**/*.ts",
    "packages/*/vite.config.mts",
    "packages/*/vitest.config.mts",
    "examples/*/vite.config.ts",
    "packages/*/setup-files.ts",
    "packages/graphiql/src/*.spec.tsx",
    "packages/cm6-graphql/__tests__/**/*.ts",
    "packages/graphql-language-service/benchmark/index.ts",
    "packages/graphiql/cypress.config.ts",
    "packages/graphiql/__mocks__/codemirror.ts",
    "packages/monaco-graphql/test/*.test.ts",
    "packages/vscode-graphql-syntax/tests/**/*.ts",
    "packages/vscode-graphql-syntax/serializer.ts"
  ]
}

{
  "extends": "./resources/tsconfig.base.cjs.json",
  "compilerOptions": {
    "composite": true
  },
  "files": [],
  "references": [
    {
      "path": "resources/tsconfig.build.esm.json"
    },
    {
      "path": "resources/tsconfig.build.cjs.json"
    }
  ]
}
